  JRENNIE, Christina and ANGELOV, Rossen Dimitrov
  01> ANGELOVA, Catherine Rossen (Katie)
  b 23.09.1980
  Katie b. at Auckland. She lived in Bulgaria from 1980 to 1985. She attended Mount Roskill
  Grammar School (1994-98) and participated in a school exchange programme in Avion, France, in
  the first half of 1998.
  02> ANGELOV, Antony Rossen
  b 31.12.1982
  Tony b. at Auckland, He lived in Bulgaria from 1983 to 1985 and now attends Mount Roskill
  Grammar School.
  04> RENNIE, William James (Bill) m on 22.05.1979 to MacLEOD, Dale
  b 11.01.1948
  b 15.05.1943
  William b. at Dunedin and m. at Harwich Port, Cape Cod, Massachusetts, USA. Dale, d/o Carl Smith
  and Janet Whitefield, b. at Toronto, Canada. Dale has daughters Dawn Kelly MacLeod (b. 16.08.1963)
  and Michelle Ann MacLeod (b. 15.04.1966, d. 22.09.1988). Address: 54 Malabar Crescent, Brampton,
  Ontario LGS 3X8, Canada.
  William was educated at Whangarei Boys' High School, Auckland Technical Institute (NZC Mech Eng)
  and Toronto Centennial College (Arch Drafting). He is now employed in property development and
  management in Toronto. Dale is a secretaryl receptionist.
  01> RENNIE, Amber Caroline Manea
  b 30.11.1979
  Amber b. at Toronto, Ont, Canada.
  04>' WILLIAMS, Dinah Gordon m on 12.12.1958 to GOOCH, John
  b 02.09.1923 d 11.12.1971
  b 13.06.1922 d 19.08.1995
  Dinah was educated at Woodford House. She worked in the cipher office during WW2 and later worked for
  the International Refugee Organisation in Switzerland. She obtained her pilot's licence after the war
  and flew for the Tauranga Aero Club.
  John was born in England. He served in the British Army during WW2 then moved to New Zealand in 1947.
  He worked for the "Auckland Star" for many years and began teaching in 1964.
  ****
  01> GOOCH, Michael John m on 24.01.1997 to PITCEATHLY, Amanda Stuart
  b 18.06.1960
  b ** ** ****
  Michael b. at Auckland, Amanda b. in England. She has two children, Alexandra and Vanessa, from a
  previous marriage.
  Michael was educated at Auckland Grammar School. He has worked for the Department of Labour as an
  employment advisor and labour inspector.
  Amanda obtained a degree in Social Work from Massey University. The family moved to New Plymouth
  in 1996.
